INSERT INTO core_newspage (page_ptr_id, external_id, summary, date, slug_override, body, author_name, cover_id) VALUES (23, 4, 'Đây là bài viết test được tạo từ Wagtail admin để kiểm tra sync với frontend.', '2025-09-15', '', '[{'id': '9139464c-110d-4976-b38d-c0ba2627267c', 'type': 'paragraph', 'value': '<p><strong>Đây là bài viết test</strong> được tạo từ Wagtail admin.</p><p>Mục đích để kiểm tra việc đồng bộ dữ liệu giữa Wagtail admin và frontend API thông qua bảng cms_content_entry.</p><p>Nếu bạn thấy bài viết này trên frontend, nghĩa là tích hợp đã thành công! 🎉</p>'}, {'id': '5ca4bbdb-58fd-47fa-b0c5-d2b54d550f87', 'type': 'quote', 'value': 'Việc tích hợp thành công giữa Wagtail CMS và frontend API sẽ giúp quản lý nội dung dễ dàng hơn.'}]', 'Admin Test', NULL);
